import React from 'react';
import ReactDOM from 'react-dom';

const Todolist = () => {
  return (
    <ul>
      <li>Learn React</li>
      <li>Build Awesome App</li>
    </ul> 
  );
};

const AppHeader = () => {
  return (
    <h1>My Todo List</h1>
  );
};

const SearchPanel = () =>{
  return <input placeholder="search" />;
};

const App = () => {
  return (
    <div>
      <AppHeader />
      <SearchPanel />
      <Todolist />
   </div>
  );
};

ReactDOM.render(<App />,
   document.getElementById('root'));
